description:
The story centres on Evelyn Salt, a CIA officer who is fingered as a Russian sleeper spy. She eludes capture by superiors who are convinced she is out to assassinate the president. While trying to reunite with her family, she struggles to prove someone else is the traitor.



Starring Angelina Jolie, Liev Schreiber, Chiwetel Ejiofor, Yara Shahidi, Victor Slezak, Gaius Charles, Kevin O'Donnell, Daniel Olbrychski, Cassidy Hinkle, James Cronin, Marion McCorry, Corey Stoll 
Director Phillip Noyce 
